import React from "react";
import Child from "./Child";
import Card from "./Card";

import "bootstrap/dist/css/bootstrap.min.css"
function App() {
    return (
        <div className = "container text-center">
            <h1>React 공부를 시작합시다.</h1>
            <Child props = {"자식1"}/>
            <Child props = {"자식2"}/>
            <Child props = {"자식3"}/>
            <Child props = {"자식4"}/>
            <Child props = {"자식5"}/>
            <Child />

            <Card p = {"image1"}/>
            <Card p = {"image2"}/>
            <Card p = {"image3"}/>
            <Card p = {"image4"}/>
            <Card p = {"image5"}/>
            <Card />

            <Child path = {"https://mblogthumb-phinf.pstatic.net/MjAyMzA0MTVfMTEy/MDAxNjgxNTMxOTUwMjYy.OOz8_eYGOArI8zAXd3Zj-niTNGXsb2T7r2uzGuwHwFwg.F8Ek8a91WNq-WtRZadNzprh_Y59g1ulKurPY-yDHQrYg.JPEG.johtaa27/resized_IMG_2671.jpg?type=w800"} name = {"망곰"} />

        </div>
        // <div></div> 로 감싸주거나 그냥 태그를 이용하거나
        // <React.Fragment></React.Fragment>로도 감싸줄 수 있는데 이건 잘 안쓴다. 비용문제도 있음.
    );
}

export default App;
